from typing import List
import numpy as np

def path_length_comparison(contour1: List[List[int]], contour2: List[List[int]]) -> float:
    length1 = np.sum(np.sqrt(np.sum(np.diff(np.vstack((contour1, [contour1[0]])), axis=0)**2, axis=1)))
    length2 = np.sum(np.sqrt(np.sum(np.diff(np.vstack((contour2, [contour2[0]])), axis=0)**2, axis=1)))

    return abs(length1 - length2)
